DROP TABLE IF EXISTS songs;
DROP TABLE IF EXISTS albums;
DROP TABLE IF EXISTS artists;
DROP TABLE IF EXISTS order_lines;
DROP TABLE IF EXISTS orders;
DROP TABLE IF EXISTS customers;

CREATE TABLE albums (
    album_id integer NOT NULL,
    name character varying(255),
    release_year integer,
    genre character varying(100),
    available boolean,
    artist_id integer
);

ALTER TABLE albums ALTER COLUMN album_id ADD GENERATED ALWAYS AS IDENTITY (
    SEQUENCE NAME albums_album_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);

CREATE TABLE artists (
    artist_id integer NOT NULL,
    name character varying(255),
    active boolean,
    founded_year integer
);

ALTER TABLE artists ALTER COLUMN artist_id ADD GENERATED ALWAYS AS IDENTITY (
    SEQUENCE NAME artists_artist_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);

CREATE TABLE customers (
    customer_id integer NOT NULL,
    fname character varying(100),
    sname character varying(100),
    country character varying(100)
);

ALTER TABLE customers ALTER COLUMN customer_id ADD GENERATED ALWAYS AS IDENTITY (
    SEQUENCE NAME customers_customer_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);

CREATE TABLE order_lines (
    order_id integer NOT NULL,
    album_id integer NOT NULL,
    quantity integer
);

CREATE TABLE orders (
    order_id integer NOT NULL,
    order_time timestamp without time zone DEFAULT now(),
    status character(1) NOT NULL,
    customer_id integer,
    CONSTRAINT orders_status_check CHECK ((status = ANY (ARRAY['i'::bpchar, 'p'::bpchar, 's'::bpchar, 'd'::bpchar, 'c'::bpchar, 'h'::bpchar, 'r'::bpchar])))
);

ALTER TABLE orders ALTER COLUMN order_id ADD GENERATED ALWAYS AS IDENTITY (
    SEQUENCE NAME orders_order_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);

CREATE TABLE songs (
    song_id integer NOT NULL,
    name character varying(255),
    "position" integer,
    length_sec integer,
    album_id integer,
    artist_id integer
);

ALTER TABLE songs ALTER COLUMN song_id ADD GENERATED ALWAYS AS IDENTITY (
    SEQUENCE NAME songs_song_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1
);







